  false,\n\t\"url\": null,\n\t\"notes\": \"Conductivity Temperature and Depth (CTD)
  measurements were collected aboard the R/V Endeavor to determine physical oceanographic
  parameters of the water column, and in some cases used to help guide sample collection
  as part of the Deepwater Horizon oil spill sampling effort. Temperature, conductivity/salinity,
  depth, dissolved oxygen, and fluorometry data were collected onboard the R/V Endeavor,
  Cruise 01. The final product is a series of NetCDF files containing every CTD cast
  that has been processed and quality checked.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
